package variableTest;

public class VariableTest1 {
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int num1 = 123;
		float num2 = 2.55534F;
		double num3 = 2.5534;
		char char1 = '공';
		String str1 = "공공칠빵";
		
		System.out.printf("int : %d\n",num1);
		System.out.printf("float : %f\n",num2);
		System.out.printf("double : %f\n",num3);
		System.out.printf("char : %c\n",char1);
		System.out.printf("String : %s\n",str1);
		
	}
}
